import React from 'react';
import styled from "styled-components";

const FooterBlock = styled.div`
    background-color: white;
`



const Footer = () => {
    return (
        <>
        <FooterBlock>이<br/>곳<br/>은 푸터영역</FooterBlock>
        </>
    );
};

export default Footer;
